DA/SA with manual safety;
Front slide serrations;
Three 16-round (9mm)
Ambidextrous decocking/manual safety levers;
Reversible magazine release;
External hammer;
Stainless Steel barrel;
Stainless Steel slide;
Ameriglo night sights (2012 date) plus original stock sights.

Additional features include a full-length guide rod, ergonomic, checkered polymer frame with interchangeable backstraps and integrated accessory rail and a lockable, fitted hard case.

This version also features the manual safety option. The safety may be applied while the hammer is cocked.

Looking to trade for Glock 29, 30,nwith rail, 36, 23, 19

Local Tampa area transaction. Must sign BOS/trade. Proper ID a must.

